export default {
    getCollections(state){
        return state.collections
    },
    getCountries(state){
        return state.countries
    },
    getSuppliers(state){
        return state.suppliers
    },
    getSidebarOption(state){
        return state.sidebar
    },
    getBanners(state){
        return state.banners
    }
}
